        --><div style="height:3.369cm;width:17.223cm; padding:0;  float:left; position:relative; left:-41,17cm; top:5.445cm; " class="fr2" id="Cadre4"><!--Next 'div' was a 'draw:text-box'.--><div style=""><p class="P8"><span class="T9">C</span><span class="T5">ontrôleuse de gestion pendant 12 ans, </span><span class="T9">la c</span><span class="T5">ompréhesion de</span><span class="T8">s besoins </span><span class="T9">et problématiques</span><span class="T8"> de </span><span class="T5">mes interlocuteurs a toujours été un moteur, </span><span class="T9">afin de leur apporter</span><span class="T8"> des solutions adaptées. </span></p><p class="P8"><span class="T5">En reconversion à la Wild Code School, </span><span class="T9">j</span><span class="T4">e </span><span class="T9">me forme</span><span class="T4"> sur les technologies Javascript et ReactJS pour l'essentiel, dans une dynamique Agile. </span><span class="Strong_20_Emphasis"><span class="T7">Je</span></span><span class="Strong_20_Emphasis"><span class="T6"> recherche un stage de fin d'études à partir d'août 2019 en full-stack dans la région de Brest/Quimper,</span></span><span class="Strong_20_Emphasis"><span class="T7"> pour mettre en pratique ces acquis et consolider mes compétences. </span></span></p></div></div><!--Next '

        --><div style="height:3.369cm;width:17.223cm; padding:0;  float:left; position:relative; left:-41,17cm; top:5.445cm; " class="fr2" id="Cadre4"><!--Next 'div' was a 'draw:text-box'.--><div style=""><p class="P8"><span class="T9">C</span><span class="T5">ontrôleuse de gestion pendant 12 ans, </span><span class="T9">la c</span><span class="T5">ompréhesion de</span><span class="T8">s besoins </span><span class="T9">et problématiques</span><span class="T8"> de </span><span class="T5">mes interlocuteurs a toujours été un moteur, </span><span class="T9">afin de leur apporter</span><span class="T8"> des solutions adaptées. </span></p><p class="P8"><span class="T5">En reconversion à la Wild Code School, </span><span class="T9">j</span><span class="T4">e </span><span class="T9">me forme</span><span class="T4"> sur les technologies Javascript et ReactJS pour l'essentiel, dans une dynamique Agile. </span><span class="Strong_20_Emphasis"><span class="T7">Je</span></span><span class="Strong_20_Emphasis"><span class="T6"> recherche un stage de fin d'études à partir d'août 2019 en full-stack dans la région de Brest/Quimper,</span></span><span class="Strong_20_Emphasis"><span class="T7"> pour mettre en pratique ces acquis et consolider mes compétences. </span></span></p></div></div><!--Next '
